import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Page1.css';

export default function Page1() {
  const navigate = useNavigate();

  const handleStartClick = () => {
    navigate('/page2');
  };

  return (
    <div className='bgg'>
      <nav className="navbar navbar-expand-lg d-flex justify-content-between align-items-center mb-5">
        {/* Navbar content */}
      </nav>
      <div>
        <img className='splash' src="splash.jpg" alt="Splash" />
      </div>
      <div className='center'>
        <p>Welcome to</p>
        <h1>Cyber Safety</h1>
        <p>Click start when you are ready to begin.</p>
        <button className="btn btn-primary rounded-4 w-25" onClick={handleStartClick}>Start</button>
      </div>
    </div>
  );
}
